import React from "react";

function MenuItem({item}){

    const {name, price, description} = item
    return (
        <div className="item-tile"> 
            <h3>{name}</h3>
            <h5>${price}</h5>
            <p>{description}</p>
         </div>
    )
}

export default MenuItem;
